import React, {useState, useRef} from "react";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import { CardActionArea, CardActions } from '@mui/material';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { Handle, Position } from 'react-flow-renderer';
import TextField from '@mui/material/TextField';
const handleStyle = { left: 10 };



export default function UserTextComponent(key){
    const [fields, setFields] = useState([])
    const [fieldCount, setFieldCount] = useState(0)
    const [isNLP, setIsNLP] = useState(false)
    const [nlpType, setNLPType] = useState(0)
    const cardRef = useRef(null)

    const handleCountChange = (event,number) =>{
        setFieldCount(parseInt(event.target.value));
    }

    const handleTextChange = (event, index) => {
        console.log('Value changed for!!',index)
        var existingButtons = [...fields]
        existingButtons[index] = event.target.value
        setFields(existingButtons)
    }
    const handleNLPChange = (event) => {
        setIsNLP(event.target.value === 'true')
    }

    const handleNLPTypeChange = (event) => {
        setNLPType(parseInt(event.target.value))
    }

    return (
        <>
            <Handle type="target" position={Position.Top} isValidConnection={key.data.validationCallback}/>
            <Card sx={{ maxWidth: '90vw'}} key = {key} ref = {cardRef}>
                <CardActionArea>
                    <CardContent sx = {{padding:'8px 15px'}}>
                        <AppBar position="static" color="secondary" sx = {{marginBottom:'6px',borderRadius:'10px'}}>
                            <Toolbar variant="dense" sx={{minHeight:'5%',justifyContent:'center'}}>
                            <Typography variant ="subtitle1" color="black" component="div"  sx={{lineHeight:'15px',fontSize :"0.75rem"}}>
                                User Response
                            </Typography>
                            </Toolbar>
                        </AppBar>
                        {/* <Select
                            labelId="demo-simple-select-label"
                            id="demo-simple-select"
                            value={buttonCount}
                            label="Button Count"
                            // data-cy="select"
                            onChange={(event) => {
                               console.log('Value Changed')
                            }}
                        >
                            <option value={1}>1</option>
                            <option value={2}>2</option>
                            <option value={3}>3</option>
                        </Select> */}
                        <label>
                            Enable NLP? &nbsp; 
                            <select
                                id="demo-simple-select"
                                value={isNLP}
                                label="Total Fields"
                                // data-cy="select"
                                onChange={handleNLPChange}
                            >
                                <option value={true} >Yes</option>
                                <option value={false} >No</option>
                            </select>
                        </label>
                        <br />
                        <br />
                        {
                            isNLP &&
                            <>
                                <label>
                                    NLP Type &nbsp; 
                                    <select
                                        id="demo-simple-select"
                                        value={nlpType}
                                        label="Total Fields"
                                        // data-cy="select"
                                        onChange={handleNLPTypeChange}
                                    >
                                        <option value={1} >Semantic Matching</option>
                                        <option value={0} >Content Extraction</option>
                                    </select>
                                </label>
                                <br />
                                <br />
                            </>
                        }
                        <label>
                            Total Fields &nbsp; 
                            <select
                                id="demo-simple-select"
                                value={fieldCount}
                                label="Total Fields"
                                // data-cy="select"
                                onChange={handleCountChange}
                            >
                                <option value={0} >0</option>
                                <option value={1} >1</option>
                                <option value={2}>2</option>
                                <option value= {3}>3</option>
                                <option value={4}>4</option>
                            </select>
                        </label>
                        {
                            [...Array(parseInt(fieldCount))].map((value, index)=>(
                                <TextField id="outlined-basic" label={"Field "+(index+1)} onChange = {(event)=> handleTextChange(event, index)} variant="outlined" sx = {{margin:'10px'}}/>
                            ))


                        }
                    </CardContent>
                </CardActionArea>
            </Card>
            {
                [...Array(parseInt(fieldCount))].map((value, index)=>(
                    <Handle type="source" position={Position.Bottom} id={index} style={{left: (cardRef.current.offsetWidth/(fieldCount+1)*(index+1))}} />
                ))

            }
        </>
        )
  };
